import React from 'react';
import Select from 'react-dropdown-select';
import '../styles/Dropdown.css';

const Multi = ({ options, title }) => (
  <React.Fragment>
    <Select
      multi
      options={1,2,3,4}
      values={[]}
      onChange={(value) =>
        console.log(`%c > onChange ${title} `, 'background: #555; color: tomato', value)
      }
    />
  </React.Fragment>
);

Multi.propTypes = {};


export default Multi;
